-- tbl_interstitial_info インタースティシャル広告情報
--------------------------------------------
create table if not exists  tbl_interstitial_info (
    id INTEGER primary key,
    media_id TEXT,
    rate INTEGER,
    width INTEGER,
    height INTEGER,
    adhtml TEXT,
    update_time INTEGER
);
